@EU_Commission Please stop this infuriating bullshit.
The #EU are not the creators of peace in #Europe.  It was the war fatigue and human costs, plus the existence of NATO that has maintained the peace since 1945.
The #EU is becoming as bad as the #Kremlin for putting out spurious propaganda.

@EU_Commission I would love to see EU citizens more actively discussing about these huge possibilities, and to have economists, and entrepreneurs noticing these posts.
We can do better in EU but to leave these topics to internet trolls.
In the USA such news would attract more conversation?
